import React from 'react';
import useSticky from './../../component/hooks/useSticky.js';
import Navbar from './../../component/Navbar/Navbar';
import { Col, Row, Rate, Menu, Dropdown, Button, Input } from 'antd';
import Footer from './../../component/Footer/Footer';
import { UserOutlined,LockOutlined  } from '@ant-design/icons';


const Profile = () => {
  const { isSticky, element } = useSticky();

  const suffix = (
    <UserOutlined
      style={{
        fontSize: 16,
        cp: 'black',
      }}
    />
  );

  const suffix2 = (
    <LockOutlined
      style={{
        fontSize: 16,
        cp: 'black',
      }}
    />
  );
  return (
    <div>
      <Navbar sticky={isSticky} />
      <main style={{ backgroundColor: '#FAFAFA' }}>
        <section className="welcome">
          <div ref={element} style={{display:'flex',height: '100%',flexDirection:'column',justifyContent:'center',alignItems:'center',paddingTop:'120px'}}>
          <p style={{fontSize:'48px',fontWeight: '700',marginTop:'50px'}}>WELCOME BACK</p>
          <div style={{marginTop:'54px',display:'flex',flexDirection:'row',alignItems:'center'}}>
                <img src="./image/Product/productAvt.png" alt="avatar" style={{width: '108px',height:'108px',borderRadius:'108px'}} />
                <div style={{display: 'flex',flexDirection:'column',justifyContent:'space-between'}}>
                    <p style={{fontWeight:'700'}}>Veri beautiful lady</p>
                    <p style={{fontWeight:'700',fontFamily:'Lato'}}>sample@gmail.com</p>
                </div>
          </div>

          </div>
        </section>
      </main>
      <Footer />
    </div>
  );
};

export default Profile;
